import "./App.css";
import CateNav from "./Components/CateNav";
import ArticleList from "./Components/ArticleList";

function App() {
	return (
		<div className="app-body">
		  <header className="App-header">
        <CateNav />
      </header>
      <main>
        <ArticleList />
      </main>
		</div>
	);
}

export default App;
